(1, '2', 'স্থানীয় হটলাইন', '<h3>৩৩৩ কল সেন্টার</h3><p><strong>১।</strong> <strong>নামঃ</strong> <strong>৩৩৩</strong></p><p><strong>২।</strong> <strong>শর্ট</strong> <strong>কোডঃ</strong> &nbsp;333 (যে কোন মোবাইল হতে)</p><p>৩। <strong>লং কোডঃ</strong>&nbsp; <strong>09666789333</strong> ( টেলিফোন ও বিদেশ হতে)</p><p><strong>৪।</strong> <strong>কল</strong> <strong>চার্জঃ</strong>&nbsp; &nbsp;&nbsp;<strong>৬০</strong> পয়সা / মিনিট</p><p><strong>৫।</strong> <strong>অপারেশনঃ</strong> &nbsp;&nbsp;&nbsp;২৪X৭ এবং ১X৩৬৫</p><p><strong>৬।</strong> <strong>উদ্দেশ্যঃ</strong></p><ul><li>জাতীয় তথ্য বাতায়নের সকল ওয়েবসাইটের তথ্য প্রদান;</li><li>সকল সরকারি সেবা প্রাপ্তির পদ্ধতির তথ্য প্রদান;</li><li>বিভিন্ন জেলা ও উপজেলা সম্পর্কিত তথ্য প্রদান;</li><li>সরকারি কর্মকর্তাদের সাথে যোগাযোগের তথ্য প্রদান;</li><li>সামাজিক সমস্যা প্রতিকারে জেলা প্রশাসক ও উপজেলা নির্বাহী অফিসারদের নিকট অভিযোগ দাখিল;</li></ul><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>hjghvjbhkn</td><td>,mnbv</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr></tbody></table></figure><p>কৃষি সম্প্রসারণ অধিদপ্তর</p><figure class=\"table\"><table><thead><tr><th><strong>নাম</strong></th><th><strong>মোবাইল</strong></th><th><strong>টেলিফোন</strong></th><th><strong>পদবি</strong></th></tr></thead><tbody><tr><td>মোঃ রফিকুল ইসলাম</td><td>01716979493</td><td>02-9111210</td><td>উপ-পরিচালক</td></tr></tbody></table></figure><p>জেলা তথ্য অফিস</p><figure class=\"table\"><table><thead><tr><th><strong>নাম</strong></th><th><strong>মোবাইল</strong></th><th><strong>টেলিফোন</strong></th><th><strong>পদবি</strong></th></tr></thead><tbody><tr><td>টেস্ট অফিসার ২</td><td>০১২৩৪৫৬৭৮৯</td><td>৯৮৫৬৪২১</td><td>অফিসার</td></tr></tbody></table></figure>', NULL, NULL),
(3, '1', 'দর্শনীয় স্থান', '<h3>দর্শনীয় স্থান</h3><figure class=\"table\"><table><thead><tr><th>ক্রমিক</th><th>নাম</th><th>কিভাবে যাওয়া যায়</th><th>অবস্থান</th></tr></thead><tbody><tr><td>১</td><td><a href=\"http://dinajpur.gov.bd/site/tourist_spot/1fa99933-18ff-11e7-9461-286ed488c766/%E0%A6%A8%E0%A7%9F%E0%A6%BE%E0%A6%AC%E0%A6%BE%E0%A6%A6%20%E0%A6%AE%E0%A6%B8%E0%A6%9C%E0%A6%BF%E0%A6%A6\">নয়াবাদ মসজিদ</a></td><td>নয়াবাদ মসজিদ দিনাজপুর জেলার কাহারোল উপজেলার রামচন্দ্রপুর ইউনিয়নের নয়াবাদ গ্রামে অবস্থিত। জেলা সদর থেকে ২০ কিমি উত্তর-পশ্চিমে ঢেপা নদীর পশ্চিম তীরে এর অবস্থান।</td><td>&nbsp;</td></tr><tr><td>২</td><td><a href=\"http://dinajpur.gov.bd/site/tourist_spot/1faaaf57-18ff-11e7-9461-286ed488c766/%E0%A6%95%E0%A6%BE%E0%A6%A8%E0%A7%8D%E0%A6%A4%E0%A6%9C%E0%A7%80%E0%A6%89%20%E0%A6%AE%E0%A6%A8%E0%A7%8D%E0%A6%A6%E0%A6%BF%E0%A6%B0\">কান্তজীউ মন্দির</a></td><td>দিনাজপুর শহর থেকে প্রায় ১২ মাইল উত্তরে এবং দিনাজপুর-তেতঁলিয়া সড়কের প্রায় এক মাইল পশ্চিমে ঢেপা নদীর পারে এক শান্ত নিভৃতগ্রাম কান্তনগরে এ মন্দিরটি স্থাপিত।</td><td>&nbsp;</td></tr><tr><td>৩</td><td><a href=\"http://dinajpur.gov.bd/site/tourist_spot/1faaf960-18ff-11e7-9461-286ed488c766/%E0%A6%B8%E0%A7%8D%E0%A6%AC%E0%A6%AA%E0%A7%8D%E0%A6%A8%E0%A6%AA%E0%A7%81%E0%A6%B0%E0%A7%80\">স্বপ্নপুরী</a></td><td>দিনাজপুর শহর থেকে ৫২ কিমি দক্ষিণে নবাবগঞ্জ উপজেলার আফতাবগঞ্জে স্বপ্নপুরী অবস্থিত। বাসযোগে যাওয়া যেতে পারে অথবা রেলযোগে ফুলবাড়ী রেল স্টেশনে নেমে অটোরিক্সায় যাওয়া যায়।</td><td>&nbsp;</td></tr><tr><td>৪</td><td><a href=\"http://dinajpur.gov.bd/site/tourist_spot/1fab0516-18ff-11e7-9461-286ed488c766/%E0%A6%B0%E0%A6%BE%E0%A6%9C%E0%A6%AC%E0%A6%BE%E0%A7%9C%E0%A7%80\">রাজবাড়ী</a></td><td>দিনাজপুর রাজবাড়ী দিনাজপুর শহরের উত্তর-পশ্চিম দিকে ফুলবাড়ী বাসস্ট্যান্ড মোড় হতে পঞ্চগড় ঠাকুরগাওগামী মহাসড়কের চিরিরবন্দর সংযোগ সড়কের মোড় হতে ১ কিঃমিঃ অটোরিকশা যোগে।</td><td>&nbsp;</td></tr><tr><td>৫</td><td><a href=\"http://dinajpur.gov.bd/site/tourist_spot/1faded90-18ff-11e7-9461-286ed488c766/%E0%A6%B0%E0%A6%BE%E0%A6%AE%20%E0%A6%B8%E0%A6%BE%E0%A6%97%E0%A6%B0\">রাম সাগর</a></td><td>দিনাজপুর সদর থেকে অটো/রিক্সা যোগে।</td><td>&nbsp;</td></tr><tr><td>৬</td><td><a href=\"http://dinajpur.gov.bd/site/tourist_spot/581549aa-f142-4f88-a755-469d336f0548/%E0%A6%B8%E0%A7%81%E0%A6%96%20%E0%A6%B8%E0%A6%BE%E0%A6%97%E0%A6%B0%20%E0%A6%87%E0%A6%95%E0%A7%8B%E0%A6%AA%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%95\">সুখ সাগর ইকোপার্ক</a></td><td>দিনাজপুর শহর হতে উত্তর পূর্ব দিকে ২ কিলোমিটার দূরে রাজবাটী এলাকায় অবস্থিত।</td><td>&nbsp;</td></tr></tbody></table></figure>', NULL, NULL),
(4, '1', 'হোটেল ও আবাসন', '<h3>হোটেল ও আবাসন</h3><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td colspan=\"4\"><p><strong>সরকারি রেষ্ট হাউজ/ গেষ্ট হাউজ/ ডাকবাংলো</strong></p><p>&nbsp;</p><p>&nbsp;</p></td><td>&nbsp;</td></tr><tr><td><strong>ক্র:নং</strong></td><td colspan=\"2\"><strong>নাম ও ঠিকানা</strong></td><td><strong>পরিচালনাকারী</strong></td><td>সিট ভাড়া</td></tr><tr><td>১।</td><td colspan=\"2\"><p><a href=\"http://www.dcdinajpur.gov.bd/index.php?opxion=com_content&amp;view=article&amp;id=167&amp;option=com_content\">সার্কিট হাউস, দিনাজপুর।</a></p><p>ফোন: ০৫৩১-৬৩১১২</p></td><td>জেলা প্রশাসন,দিনাজপুর</td><td><p>মোট সিট-১৩ টি, সবগুলো AC, &nbsp;</p><p>&nbsp;সরকারী- ভাড়া- রুম নং- ১-৩ পর্যন্ত ৭০ টাকা</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; রুম নং-৪-৮ পর্যন্ত ১৩০ টাকা</p></td></tr><tr><td>২।</td><td colspan=\"2\"><p>পর্যটন মোটেল, দিনাজপুর।</p><p>ফোন: ০৫৩১-৬৪৭১৮</p></td><td>বাংলাদেশ পর্যটন কর্পোরেশন</td><td>মোট সিট-৩৬ টি, AC-৩২ টি, ভাড়া, ৩২০০/-, ২৮০০/- , NON AC-৪টি, ভাড়া-১২০০/-</td></tr><tr><td>৩।</td><td colspan=\"2\"><p>রামসাগর জাতীয় উদ্যান রেষ্ট হাউজ, তাজপুর, সদর, দিনাজপুর।</p><p>ফোন: ০৫৩১-৬৫৫৫৮, ফ্যাক্স: ০৫৩১-৬৩০৯০</p></td><td>সামাজিক বন বিভাগ,দিনাজপুর</td><td><p>মোট সিট-৭ টি,</p><p>AC- ১টি,</p><p>ভাড়া-সরকারি-১০০০/- এবং ১৫%,&nbsp; বেসরকারি ১৫০০/- এবং ১৫% ভ্যাট</p><p>&nbsp;NON-AC-৬টি,</p><p>ভাড়া- সরকারি ৫০০/- এবং ১৫% ভ্যাট, বেসরকারি ৮০০/- এবং ১৫% ভ্যাট</p></td></tr><tr><td>৪।</td><td colspan=\"2\"><p><a href=\"http://www.dcdinajpur.gov.bd/index.php?option=com_content&amp;view=article&amp;id=243\">দিনাজপুর জেলা পরিষদ ডাকবাংলো</a></p><p>&nbsp;</p></td><td><p><a href=\"http://www.dcdinajpur.gov.bd/index.php?option=com_content&amp;view=article&amp;id=243\">দিনাজপুর জেলা পরিষদ, ডাকবাংলো</a></p><p>ফোন: ০৫৩১-৬৫০৫৬,</p><p>মোবাইল নং-০১৭২০৪৩৬২১৮</p><p>&nbsp;</p></td><td><p>মোট সিট-১৬ টি, AC-৪টি, ভাড়া- সরকারি-৬০০/-&nbsp;&nbsp; বেসরকারি-১২০০/-</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NON-AC-১২ টি, ভাড়া- সরকারি-১০০/-</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বেসরকারি-১৫০/-</p></td></tr><tr><td>৫।</td><td colspan=\"2\"><p>পানি উন্নয়ন বোর্ড রেষ্ট হাউজ, মিশন রোড, দিনাজপুর।</p><p>ফোন নং০৫৩১-৬৩২৫২, ফ্যাক্স:০৫৩১-৬৩২৫২</p></td><td>বাংলাদেশ পানি উন্নয়ন বোর্ড, দিনাজপুর</td><td><p>মোট সিট- ৬টি, AC-১টি, ভাড়া-সরকারি-১৮০/-&nbsp; বেসরকারি-৩৫০/-</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NON-AC-৫টি ভাড়া-সরকারি-১০০/-</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বেসরকারি-১৮০/-</p></td></tr><tr><td>৬।</td><td colspan=\"2\"><p>এলজিইডি রেষ্ট হাউজ, মিশনরোড, দিনাজপুর।</p><p>ফোনঃ ০৫৩১-৬৩৩৮১</p></td><td>এলজিইডি, দিনাজপুর</td><td><p>মোট সিট-৩টি, AC ভাড়া- সরকারি-৭০/-&nbsp; বেসরকারি-৫০০/-</p><p>বিদেশী-১০০০/-</p></td></tr><tr><td>৭।</td><td colspan=\"2\"><p>হর্টিকালচার সেন্টাররেষ্ট হাউজ, সুইহাড়ি, দিনাজপুর।</p><p>ফোন নং০৫৩১-৬৪৭৪৮</p></td><td>হর্টিকালচার সেন্টার, দিনাজপুর</td><td>মোট সিট-৫টি, NON-AC- ভাড়া-৮০/-</td></tr><tr><td>৮।</td><td colspan=\"2\"><p>পাট বীজ খামারের রেষ্ট হাউজ, নশিপুর, দিনাজপুর সদর, দিনাজপুর।</p><p>ফোনঃ ০৫৩১-৬৫১৯১</p></td><td>বাংলাদেশ কৃষি উন্নয়ন কর্পোরেশন (বিএডিসি)</td><td><p>মোট সিট-৫টি</p><p>AC-ভাড়া-১৩০/-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NON AC- ভাড়া-৯০/-</p></td></tr><tr><td>০৯।</td><td colspan=\"2\"><p>অতিথি ভবন, গম ও ভুট্টা গবেষনা ইন্সটিটিউট, নশিপুর, দিনাজপুর।</p><p>&nbsp;</p></td><td><p>বাংলাদেশ কৃষি গবেষণাইনষ্টিটিউট</p><p>ফোনঃ ০৫৩১-৬৩৯৫৭, ই-মেইল: <a href=\"mailto:dirwre@bari.gov.bd\">dirwre@bari.gov.bd</a></p></td><td><p>মোট সিট-১৯ টি, AC-৯ টি, ভাড়া-সরকারি-৭০/-, বেসরকারি-৫০০/-</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NON AC- ১০ টি, ভাড়া-সরকারি-৫০/-, বেসরকারি-১৫০/-</p></td></tr><tr><td colspan=\"4\"><p>&nbsp;</p><p><strong>বেসরকারি রেষ্ট হাউজ/ গেষ্ট হাউজ/ ডাকবাংলো</strong></p></td><td>&nbsp;</td></tr><tr><td>১।</td><td><p>গেষ্ট হাউজ, এফপিএবি, দিনাজপুর শাখা ঘাসিপাড়া, দিনাজপুর</p><p>&nbsp;</p></td><td colspan=\"2\"><p>ফোনঃ ০৫৩১-৬৩২১৪,</p><p>মোবাইল- ০১৭১৫৬৭২৪৫৬</p><p>&nbsp;E-Mail&nbsp;<a href=\"mailto:dinajpur@fpab.org\">dinajpur@fpab.org</a></p><p>&nbsp;</p></td><td><p>মোট সিট-৩৬টি, AC- ৯ টি, ভাড়া- ১০০০/-</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NON-AC- ২৭ টি, ভাড়া-২০০/-</p></td></tr><tr><td>২।</td><td>কারিতাস ট্রেনিং সেন্টার-কাম-গেষ্ট হাউজ, প:শিবরামপুর সদর, দিনাজপুর।</td><td colspan=\"2\"><p>&nbsp;ফোনঃ ০৫৩১-৬৫৬৭৩, মোবাইল-০১৭১৩৩৮৪০৫৯</p><p>E-Mail&nbsp;<a href=\"mailto:cbdinaj@btcl.net.bd\">cbdinaj@btcl.net.bd</a></p><p>&nbsp;</p></td><td><p>মোট সিট-৫৬টি, AC-৪টি, ভাড়া-১১৫০/-</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NON AC-৫২ টি, ভাড়া-২৩০/- এবং ১৭৬/-</p></td></tr><tr><td>৩।</td><td>পল্লী শ্রী, বালুবাড়ী, দিনাজপুর।</td><td colspan=\"2\"><p>শামিম আরা বেগম, নির্বাহী পরিচালক, পল্লী শ্রী, বালুবাড়ী দিনাজপুর</p><p>ফোনঃ ০৫৩১-৬৫৯১৭</p><p>E-Mail <a href=\"mailto:pollisre@btcl.net.bd\">pollisre@btcl.net.bd</a></p></td><td><p>মোট সিট-৬০ টি,</p><p>AC-১৯ টি, ভাড়া-১ জন-১০০০/-, ২ জন-১২০০/-</p><p>NoN AC- ৩১ টি, ভাড়া-১জন-৩৫০/-, ২ জন-৬০০/-</p></td></tr><tr><td>৪।</td><td>তৈয়বা মজুমদার রেড ক্রিসেন্ট রক্তদান কেন্দ্র রেষ্ট হাউজ, উপশহর, দিনাজপুর।</td><td colspan=\"2\"><p>পরিচালনা কমিটির পক্ষে</p><p>সেক্রেটারিজনাব এডঃ নুরুল ইসলাম</p><p>ফোনঃ ০৫৩১-৬১৩০০</p></td><td>মোট সিট-৯টি, সব AC, ভাড়া-৬০০/- ১ জন</td></tr><tr><td>৫।</td><td><p>ব্র্যাক গেষ্ট হাউজ, বাঁশের হাট, দিনাজপুর</p><p>&nbsp;</p></td><td colspan=\"2\"><p>সার্ভিস ম্যানেজার, ব্র্যাক ট্রেনিং এন্ড রিসোর্স সেন্টার, বাঁশের হাট, দিনাজপুর।</p><p>মোবাইলঃ ০১৭১১৮০৭৯৭৪</p></td><td><p>মোট সিট-৭৫ টি,</p><p>AC-২০ টি, ভাড়া-২০৭০/-২জন,</p><p>NON AC-৫৫ টি, ভাড়া-১০৭০/- ২জন</p></td></tr><tr><td>৬।</td><td><p>হোটেল সোনার তরী আবাসিক, গণেশতলা দিনাজপুর।</p><p>&nbsp;</p></td><td colspan=\"2\"><p>অংকুর রায়</p><p>মোবাইলঃ ০১৭১৬০১৮৯৯৫</p></td><td>মোট ৭টি সিট NON AC, ভাড়া ১ জন -২০০/-, ২ জন-৪০০/-</td></tr><tr><td>০৭।</td><td>স্বপ্নপুরী গেষ্ট হাউস, নবাবগঞ্জ, দিনাজপুর</td><td colspan=\"2\">মোবাইল-০১৭১২১৩৪০৯৫</td><td><p>মোট সিট-১১৭ টি,</p><p>&nbsp;AC-১৫টি, ভাড়া- ২০০০/-, ১৫০০/-</p><p>&nbsp;NON AC ১০২টি , ভাড়া-১২০০/-, ১০০০/-</p></td></tr><tr><td>০৮।</td><td>কান্তজিউ মন্দির, কাহারোল, দিনাজপুর</td><td colspan=\"2\">ফোন-০৫৩১-৬৪৭১৮</td><td><p>বাংলাদেশ পর্যটন কর্পোরেশন, দিনাজপুর</p><p>মোট ৪টি সিট NON AC, ভাড়া ১ জন -১২০০/-</p></td></tr></tbody></table></figure>', NULL, NULL),
(5, '2', 'অন্যান্য জরুরি সেবা', '<h3>মোবাইল-সেবার তালিকা : হেল্পডেস্ক</h3><figure class=\"table\"><table><tbody><tr><td>১</td><td>ঢাকা মহানগর পুলিশের জরুরী হেল্পলাইন: ১০০, ২১৭৭৭, ২১৬৬৬, ৯৫৫১১৮৮, ৯৫১৪৪০০, ০১৭১৩৩৯৮৩১১</td></tr><tr><td>২</td><td>অভিযোগ বক্স (বিদ্যুৎ, জ্বালানি ও খনিজ সম্পদ মন্ত্রণালয়)</td></tr><tr><td>৩</td><td>ফোন ডিরেক্টরি (ঢাকা দক্ষিণ সিটি কর্পোরেশন)</td></tr><tr><td>৪</td><td>ফেইসবুকে দুর্যোগ ব্যবস্থাপনা অধিদপ্তর</td></tr><tr><td>৫</td><td>ঢাকা মহানগর পুলিশের চাঁদাবাজি সংক্রান্ত অভিযোগের হেল্পলাইন : ৯৫৫৯৯৩৩, ০১৭১৩৩৯৮৩১১, ০১১৯১০০১১০০, ০১১৯১০০১১১১</td></tr><tr><td>৬</td><td>জাতীয় হেল্পডেস্কে কল করুন: ১৬৪২৬ বা +৮৮০ ৯৬১৭০ ১৬৪২৬ বা +৮৮০১৭৩০ ০৬৮৮১৪</td></tr><tr><td>৭</td><td>হিসাব নিয়ন্ত্রক অফিস হেল্পডেস্ক : কল - ৯৩৫৬৪৯৭</td></tr><tr><td>৮</td><td>প্রবাসী কল্যাণ ও বৈদেশিক কর্মসংস্থান মন্ত্রনালয়ে সহায়তা সেল: শ্রমিক আইন সহায়তা সেল- 01799-090011, 01799-090022, নারী অভিবাসন তথ্য সেবা - 8323004, 8322946, 8319322, 8317511</td></tr><tr><td>৯</td><td>মহিলা ও শিশু বিষয়ক মন্ত্রণালয়ের ন্যাশনাল হেল্পডেস্ক : ডায়াল ১০৯২১</td></tr><tr><td>১০</td><td>বাংলাদেশ লোক ও কারুশিল্প ফাউন্ডেশন (সোনারগাঁও জাদুঘর) হেল্পডেস্ক ডায়াল - ০৯৬০৪ ০০০ ৭৭৭</td></tr></tbody></table></figure>', NULL, NULL),
(6, '4', 'কিন্ডারগার্টেন', '<h4>শিক্ষা প্রতিষ্ঠানের তালিকা</h4><ul><li>অন্যান্য (০)</li><li>কলেজ (০)</li><li>কারিগরী (০)</li><li>নিম্ন মাধ্যমিক বিদ্যালয় (০)</li><li>প্রাথমিক বিদ্যালয় (০)</li><li>বিশ্ববিদ্যালয় (০)</li><li>ভোকেশনাল (০)</li><li>মাদ্রাসা (০)</li><li>মাধ্যমিক বিদ্যালয় (০)</li><li>মেডিকেল কলেজ (০)</li></ul>', NULL, NULL),
